import React, { Component } from 'react';


class LoginComponent extends Component{
    constructor(props){
        super(props);
        this.state={
            email:"",
            password:"",
        }
    }
    render() {
        return (
            <div>
                <div id="login">
                    <input onChange={this.handleContent} type="email" id="email" placeholder="Email" /><br/>
                    <input onChange={this.handleContent} type="password" id="password" placeholder="Password" /><br/>
                    <button id="send" onClick={this.handleSubmit}>Login</button>
                </div>
            </div>

        )
    }
}

export default LoginComponent;
